"""### 訓練/預測過程之共用 function"""

# 計算 model 預測的答對率 %
def calculate_accuracy(y_pred, y):
    top_pred = y_pred.argmax(1, keepdim=True)         # 從 output_dim 找出最大機率的位置，即預測為那個數字 -> top_pred: (batch_size, 1)
    correct = top_pred.eq(y.view_as(top_pred)).sum()  # 對比 ground truth 與 預測，答對有幾個？ #y.view_as(top_pred) -> 把 ground truth label 的形狀調整成和 top_pred 一樣 ->(batch_size, 1)
    acc = correct.float() / y.shape[0]
    return acc

# 訓練過程
def train(model, iterator, optimizer, criterion, device):  #iterator -> dataloader; criterion -> loss function
    epoch_loss, epoch_acc = 0, 0
    model.train()

    for (x, y) in tqdm(iterator, desc='Training', leave=False):  # tqdm 顯示進度條，方便觀察運行進度, desc: 進度條顯示的描述文字, leave: 進度條是否要保留
        # pixel (詳細可看 dataloader 區塊)
        x = x.to(device)
        # label (詳細可看 dataloader 區塊)
        y = y.to(device)

        y_pred = model(x)              # y_pred: (batch_size, output_dim), 每一筆資料有 output_dim 個維度
        loss = criterion(y_pred, y)    # 預測值與真實值之間 -> loss，回傳 model 進行修正

        acc = calculate_accuracy(y_pred, y)   # 預測值與真實值答對率


        optimizer.zero_grad()   # 清空 optimizer 的 gradient
        loss.backward()         # 反向傳播計算 gradient
        optimizer.step()        # optimizer 進行參數更新

        epoch_loss += loss.item()   # 累加一 epoch 的 loss
        epoch_acc += acc.item()     # 累加ㄧ epoch 的 acc

    return epoch_loss / len(iterator), epoch_acc / len(iterator)   # 回傳一個 epoch 訓練完畢的結果，除以 batch

def evaluate(model, iterator, criterion, device):

    epoch_loss, epoch_acc = 0, 0
    model.eval()
    # 在評估模式下，不需要計算 gradient，使用 torch.no_grad() 來節省資源
    with torch.no_grad():
        for (x, y) in tqdm(iterator, desc="Evaluating", leave=False):
            x = x.to(device)
            y = y.to(device)

            y_pred = model(x)
            loss = criterion(y_pred, y)
            acc = calculate_accuracy(y_pred, y)

            epoch_loss += loss.item()
            epoch_acc += acc.item()

    return epoch_loss / len(iterator), epoch_acc / len(iterator)

def predict(model, iterator, device):

    model.eval()

    images = []
    labels = []
    probs = []

    with torch.no_grad():
        for (x, y) in iterator:
            x = x.to(device)
            y_pred = model(x)
            y_prob = F.softmax(y_pred, dim=-1) # probability -> classification result

            images.append(x.cpu())
            labels.append(y.cpu())
            probs.append(y_prob.cpu())

    images = torch.cat(images, dim=0)
    labels = torch.cat(labels, dim=0)
    probs = torch.cat(probs, dim=0)

    return images, labels, probs

"""# 定義 MNIST classification 模型

### Model 1 - Multi-layer Perceptron (MLP)
包含三層結構(輸入層、隱藏層和輸出層)  \
除了輸入輸出外，一層以上的連接層，每層之間的節點都有連結的邊

input: 784 = 28*28

output: 10 (屬於0~9數字的機率)


![圖片 1.png](data:image/png;base64,)
"""

class MLP(nn.Module):
    def __init__(self, input_dim, output_dim):
        super().__init__()
        # 建構子
        self.input_fc = nn.Linear(input_dim, 250)     # (input_dim=784)，250 可自行更換成你希望他的維度
        self.hidden_fc = nn.Linear(250, 100)          # (250, 100)，這裡的 250 是接上一層的輸出，所以如果上一層的輸出維度改變，這一層的輸入就要跟著改變!
        self.output_fc = nn.Linear(100, output_dim)   # (100, output_dim=10)，同上

    def forward(self, x):
        # 層與層之間的流動
        # x = [batch size, height, width] -> [圖片數量, height pixel, width pixel]

        batch_size = x.shape[0]
        x = x.view(batch_size, -1)         # x: [batch size, 28*28]
        h_1 = F.relu(self.input_fc(x))     # h_1: [batch size, 250] + relu 非線性轉換
        h_2 = F.relu(self.hidden_fc(h_1))  # h_2: [batch size, 100] + relu 非線性轉換
        y_pred = self.output_fc(h_2)       # y_pred: [batch size, 10]

        return y_pred

device = torch.device('cuda' if torch.cuda.is_available() else 'cpu')
# 建立 MLP 模型
model_MLP = MLP(INPUT_DIM, OUTPUT_DIM)
# 查看 MLP 模型架構
model_MLP = model_MLP.to(device)
