for tup in zip(tokenized_text, indexed_tokens):
    print('{:<12} {:>6,}'.format(tup[0], tup[1])) # {:<12}: 左對齊，寬度為12; {:>6,}: 右對齊，寬度為6

# Mark each of the 22 tokens as belonging to sentence "1".
