for token in the_emb:

    # `token` is a [12(leyers) x 768(dimension)] tensor

    # Sum the vectors from the last four layers.
    sum_vec = torch.sum(token[-4:], dim=0) # dim=0表示沿著第0維（層維度）求和
    # 最後4層包含更多語義信息，通常用於表示詞義

    # Use `sum_vec` to represent `token`.
